function adjustHTML(html) {

    html = html.replace(/[^\w \n]/gm, '');

    // HIGHLIGHT DOUBLE ENTERS INTO WILDCARD
    html = html.replace(/\n\n/gm, '[breakLine]');

    // SPLIT HIGHLIGHTS INTO ITEMS
    var htmlArray = html.split('[breakLine]');

    // remove empty lines from array
    var newHtmlArray = [];
    // initializing having any incidents as false
    var anyIncident = false;
    for (var i = 0; i < htmlArray.length; i++) {
        // CONSIDER ONLY LINES WITH NO BLANK SPACE AS VALUE
        if (htmlArray[i]) {

            // SPLIT LINE INTO ITS VALUES
            var htmlArrayElement = htmlArray[i].split('\n');
            // ONLY GET ITENS WITH NON BLANK LINES
            if (htmlArrayElement.length !== 1) {

                // chack incident
                if (htmlArrayElement[1].indexOf('incident') > -1) {
                    anyIncident = true;
                }

                // REMOVE BLANK SPACES FROM LINES
                var newHtmlArrayElement = [];
                for (var j = 0; j < htmlArrayElement.length; j++) {

                    // CONSIDER ONLY POSITIONS WITH NON BLANK SPACES
                    if (htmlArrayElement[j]) {
                        newHtmlArrayElement.push(htmlArrayElement[j]);
                    }
                }

                // RE-push worked line
                newHtmlArray.push(newHtmlArrayElement);
            }

        }
    }

    // DEFININD SUBJECT
    var subject = (anyIncident ? "[INCIDENT DETECTED] " : '') + "Microsoft 365 Service Health Report";

    // DEFINING OUTPUT
    var output = {
        subject: subject,
        html: newHtmlArray
    };

    var stringifyedOutput = JSON.stringify(output);


    return stringifyedOutput;
}

function getMailSubject(html) {
  var data = JSON.parse(html);

  return data.subject;
}

function createMailMessage(obj) {
    var data = JSON.parse(obj);

    var mailMessage = "<img alt='AbInbev' width='242px' height='106px' style='margin: 0; padding: 0; vertical-align: middle;' src='data:image/jpeg;base64,' /><br/>";

  	var html = data.html;

    for (var i = 0; i < html.length; i++) {
        var item = html[i];
        mailMessage += "<h3>" + item[0] + "</h3>";
        mailMessage += "<h4>" + item[1] + "</h4>";

        if(item.length > 2) {
            for (var j = 2; j < item.length; j++) {
                mailMessage += item[j] + "<br/>";                
            }
        }

        mailMessage += '<hr>';
    }

    return mailMessage;

}
